import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

const faqItems = [
  {
    id: 'change-booking',
    question: 'How do I change my booking?',
  },
  {
    id: 'refund',
    question: 'How do I request a refund?',
  },
  {
    id: 'flight-status',
    question: 'How do I check my flight status?',
  },
  {
    id: 'account',
    question: 'How can I access my account?',
  },
  {
    id: 'booking-modifications',
    question: 'How do I modify my booking?',
  },
  {
    id: 'cancellation',
    question: 'How do I cancel my booking?',
  },
  {
    id: 'customer-support',
    question: 'How can I contact customer support?',
  },
  // Add more FAQ items as needed
];

export default function FAQPage() {
  return (
    <>
      <Header />
      <main className="max-w-3xl mx-auto py-10 px-4 text-gray-800">
        <h1 className="text-3xl font-bold mb-6">Help Center</h1>
        
        {/* FAQ list */}
        <ul className="space-y-4">
          {faqItems.map((faq) => (
            <li key={faq.id}>
              <Link to={`/faq/${faq.id}`}>
                <button className="w-full py-3 px-5 bg-blue-600 text-white font-semibold rounded-lg hover:bg-blue-700 transition duration-300">
                  {faq.question}
                </button>
              </Link>
            </li>
          ))}
        </ul>
      </main>
      <Footer />
    </>
  );
}
